import React from 'react';

const Listing = (props) => {
  available: true
city: "london"
condition: "great"
list_id: 3
list_name: "list_item_1"
price: "47"
seller: "test"
  return (
    <section>
      {JSON.stringify(props)}
    </section>
  )
};

export default Listing;
